std::vector<std::string> GetCommandSelection(ModuleID moduleID, size_t count)
{
	std::vector<std::string> selection;

	auto Select = [&selection, &count](const std::vector<std::string> &commands)
		{
		// Random distribution [0..sizeof commands]
		std::random_device r;
		std::default_random_engine e1(r());
		std::uniform_int_distribution<size_t> uniform_dist(0, commands.size() - 1);

		// Random fill a subset of commands
		std::vector<std::string> subset(count);
		for (size_t i = 0; i < count; ++i)
			{
			size_t cmdIndex = uniform_dist(e1);
			subset[i] = commands[cmdIndex];
			}

		// Append to selection
		selection.insert(selection.end(), subset.begin(), subset.end());
		};

	Select(allCommands[moduleID]);

	return selection;
}
